import React from "react";
import generatePopup from "../js/script";

let {image_github} = generatePopup;

const Popup = (props) =>{
    return(
        <div className="popup">
            <img className= "image-github" src={generatePopup.image_github} alt="Github profile image" />


        </div>
    );
}
export default Popup;
